import React, { Component } from 'react'

export default class FilmRow extends Component {
    render() {
        let AllTitles = this.props.films.map( (film, index) => (<h1>{film.title}</h1>))
        return (
            <div className="film-row">

            <div className="film-summary">
                <h1>TITLE</h1>
                {AllTitles}
                <p>YEAR</p>
            </div>
            </div>
        )
    }
}
